import React from 'react'
import styled from "styled-components";
import bgImg from "../assets/img/ho.jpg";

const Sec = styled.section`
position: relative;
padding-bottom: 288px;
background-repeat: no-repeat;
background-size: cover;
background-position: center;
  background-image: url(${bgImg});
`;

const IconWrap = styled.div`

  border: solid 3px green;

`;



const Section = styled.div`
display: block;
@media (min-width: 992px) {
    padding: 7em 0;
  }
`;


const Container1 = styled.div`
width: 100%;
padding-right: 15px;
padding-left: 15px;
margin-right: auto;
margin-left: auto;
@media (min-width: 992px) {
    max-width: 960px;
  }
`;

const Box = styled.div`
-webkit-box-align: center!important;
    -ms-flex-align: center!important;
    align-items: center!important;
display: flex;
-ms-flex-wrap: wrap;
flex-wrap: wrap;
margin-right: -15px;
margin-left: -15px;
`



const About = () => {
    return (
        <Section id="About" className="site-section" data-aos="fade">
        <Container1 className="container">
          <Box className="row align-items-center">
          <div className="col-md-5 ml-auto" style={{marginLeft:"100px!important"}}>
          <IconWrap>
             <Sec></Sec>
          </IconWrap>
          </div>
            <div className="col-md-5 ml-auto" >
              <div className="text-left mb-5 section-heading">
                <h2 >Pourquoi le laboratoire Fes ?</h2>
              </div>
              <p className="mb-4 h5 font-italic lineheight1-5">&ldquo;
              Laboratoire d’analyses médicales, Laboratoire Fes est le leader parmis
        plus de 50 laboratoires de biologie médicale a fes et dans le maroc,
        depuis 1995. Le Laboratoire Fes assure toute la prise en charge du
        patient, pour tous types d’analyses, avec ou sans RDV. Grâce à notre
        grand equipe de spécialistes et notre professionnalisme nous vous
        garantissons la livraison de la majorité de vos résultats d’analyses
        médicales sous 24.

              &rdquo;</p>
              <p>&mdash; <strong className="text-black font-weight-bold">John Holmes</strong>, Marketing Strategist</p>
              <p><a href="https://vimeo.com/28959265" className="popup-vimeo text-uppercase">Watch Video <span className="icon-arrow-right small"></span></a></p>
            </div>
          </Box>
        </Container1>
      </Section>
    )
}

export default About
